import React from "react";
import {Firstname,Lastname} from "./App";

const Comp3 = () =>{
return (
    <>
    <Firstname.Consumer>{
        (fname) =>{
            return (
                <Lastname.Consumer>
                    {
                        (lname) =>{
                            return (
                                <h1>
                                HEY WELCOME TO {fname} {lname}
                                </h1>
                            )
                        }
                    }
                </Lastname.Consumer>
            )
        }
    }
    </Firstname.Consumer>
    </>
)
}


export default Comp3;
